              <div>
               <img src={`http://openweathermap.org/img/wn/${img}@2x.png`} alt=""/>
              </div>
              <div>
                <p>Mínima</p>
                <p>{min}</p>
              </div>
              <div>
                <p>Máxima</p>
                <p>{max}</p>
              </div>    
          </div>
};
